DROP TABLE IF EXISTS user_db;

create table user_db (
	user_id SERIAL PRIMARY KEY     NOT NULL,
	password VARCHAR(50),
	user_name VARCHAR(50),
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	last_location VARCHAR(20)
);

